namespace AdventOfCodeTests.Year2022
{
    public class Day20Tests
    {
        [Test]
        public void GrovePositioningSystem_CanInitialise()
        {
            var grove = new GrovePositioningSystem(_exampleInput);

            grove.GroveCoords[0].Number.Should().Be(1);
            grove.GroveCoords[1].Number.Should().Be(2);
            grove.GroveCoords[2].Number.Should().Be(-3);
            grove.GroveCoords[3].Number.Should().Be(3);
            grove.GroveCoords[4].Number.Should().Be(-2);
            grove.GroveCoords[5].Number.Should().Be(0);
            grove.GroveCoords[6].Number.Should().Be(4);
        }

        [Test]
        public void Mix_ShouldShuffleNumbersCorrectly()
        {
            var grove = new GrovePositioningSystem(_exampleInput);
            grove.Mix();

            grove.GroveCoords[0].Number.Should().Be(1);
            grove.GroveCoords[1].Number.Should().Be(2);
            grove.GroveCoords[2].Number.Should().Be(-3);
            grove.GroveCoords[3].Number.Should().Be(4);
            grove.GroveCoords[4].Number.Should().Be(0);
            grove.GroveCoords[5].Number.Should().Be(3);
            grove.GroveCoords[6].Number.Should().Be(-2);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForExample1()
        {
            var grove = new GrovePositioningSystem(_exampleInput);
            grove.Mix();

            var result = grove.FindGrove();

            result.Should().Be(3);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForPart1()
        {
            var grove = new GrovePositioningSystem(_puzzleInput);
            grove.Mix();

            var result = grove.FindGrove();

            result.Should().Be(13883);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForExample2()
        {
            var grove = new GrovePositioningSystem(_exampleInput, useKey: true);
            grove.Mix(10);

            var result = grove.FindGrove();

            result.Should().Be(1623178306);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForPart2()
        {
            var grove = new GrovePositioningSystem(_puzzleInput, useKey: true);
            grove.Mix(10);

            var result = grove.FindGrove();

            result.Should().Be(19185967576920);
        }

